import React from 'react'

function Hero() {
  return (
    <div className='bg-black min-w-[350px] text-white w-screen h-screen mt-[-96px]'>
        <div className='flex flex-col justify-center text-center'>
            <p>Welcome to the DEN</p>
        </div>

    </div>
  )
}

export default Hero
